import time

import unittest
from selenium import webdriver


class JingDong2Test(unittest.TestCase):
    def setUp(self):
        self.driver = webdriver.Chrome()
        self.driver.implicitly_wait(5)
        self.driver.maximize_window()

    def tearDown(self):
        self.driver.quit()

    def test_login(self):
        self.driver.get("https://www.jd.com/")
        for cookie in JingDong2Test.list:
            self.driver.add_cookie(cookie)
        self.driver.get("https://www.jd.com/")
        time.sleep(15)
        # 判断是否登录成功
        actual = self.driver.find_element_by_class_name("nickname").text
        #self.assertEqual(actual, "")
        self.assertNotEqual(actual, "博为峰常城")



